import React from 'react';

// import './Form.css';

const Result = props => {
const {err, city, date,sunrise, sunset, temp, pressure, wind} = props.weather 
let content = null;

if(!err && city){
    content = (
        <div> 
            <h2>Search result <em>{city}</em></h2>
            <h4>Date and time: {date}</h4>
            <h4>Current temperature: {temp}</h4>
        </div>
    )
}
return (
        <div className="Result">
            {err ? `not available ${city}` 
            :content}
        </div>


  );
}

export default Result;
